import React, { Component, Fragment } from 'react';
import axios from 'axios';
import { Row } from 'react-bootstrap';
import { Col } from 'react-bootstrap';
import FilterBar from './FilterBar';
import MapContainer from './MapContainer/MapContainer';
import RestaurauntsList from './RestaurantContainer/RestaurauntsList';
import * as restarauntData from '../.././myrestauraunts.json';

class ResultsContainer extends Component {
	state = { latitude: null, longitude: null };

	componentDidMount() {
		console.log(restarauntData);
		console.log('Component Did Mount');
		window.navigator.geolocation.getCurrentPosition(
			position =>
				this.setState({
					latitude: position.coords.latitude,
					longitude: position.coords.longitude
				}),
			err => this.setState({ errorMessage: err.message })
		);

		axios
			.get(`https://jsonplaceholder.typicode.com/users`)
			.then(res => console.log(res))
			.catch(err => console.log(err));
	}

	render() {
		console.log('Component Did Render');
		return (
			<Fragment>
				<Row>
					<Col>
						<FilterBar />
					</Col>
				</Row>
				<Row>
					<main className='map_restauraunt_wrapper'>
						<Col sm={12} lg={6} xl={7}>
							<section>
								<MapContainer />
							</section>
						</Col>
						<Col sm={12} lg={6} xl={5}>
							<section>
								<RestaurauntsList />
							</section>
						</Col>
					</main>
				</Row>
			</Fragment>
		);
	}
}

export default ResultsContainer;
